import * as React from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';

export default function ContainedButtons({education, english, experience, personLanguage, sex, personSkill}) {
  const handleClick = () => {
    console.log({
      "education": education,
      "english": english,
      "experience": experience,
      "sex": sex,
      "personLanguage": personLanguage,
      "personSkill": personSkill
    })
  }
  return (
    <Box sx={{'& button' : {m : 2}}}>
      <Button variant="contained" onClick={handleClick}>Filter</Button>
    </Box>
  );
}
